import styled from 'styled-components'
import IndividualProject from './IndividualProject';
import { FaTrashAlt } from 'react-icons/fa';

const projects = ['THE OFFICE','DAILY','FUTURE','WORDS','MUSIC'];

const Styleddot = styled.span`
`
const Styledul = styled.ul`
margin-top: 20px;
margin-bottom: 20px;
display: -webkit-box;
display: -ms-flexbox;
display: flex;
flex-direction: column;
border-bottom: 1px solid #f1f1f1;;
padding-left: 10px;
// cursor: pointer;
`
const Styledli = styled.li`
    list-style-type: none;
    color: #333;
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    cursor: pointer;
    line-height: 1.50;
    font-size: 15px;
    padding-left: 0;
    padding-right: 0;
    :nth-child(1) ${Styleddot}{
        color: #6accbc;
    }
    :nth-child(2) ${Styleddot}{
        color: #fad003;
    }
    :nth-child(3) ${Styleddot}{
        color: #ff8d85;
    }
    :nth-child(4) ${Styleddot}{
        color: #ff9932;
    }
    :nth-child(5) ${Styleddot}{
        color: #af38eb；
    }
`

// const Styledul = styled.ul`
//     ${Styledli}:nth-child(1)${Styledspan}{
//         color: #6accbc;
//     }
// `

const Projects = () => {

  return (
    <Styledul>
        {
        projects.map((project) => (
        <Styledli> 
            {/* <IndividualProject name={project}/> */}
            <Styleddot>•</Styleddot>
            <h2>{project}</h2>
            <span
                tabIndex={0}
                role="button"
            >
                <FaTrashAlt />
            </span>
                </Styledli>
        ))
        }
    </Styledul>
  );
};

export default Projects;
